import Root from "./route/Root";
import { CreateUrl, UrlList, WorldsContainer, Signin, Signup } from "./route";
import { ROUTES } from "./constants";

const routes = [
  {
    component: Root,
    routes: [
      {
        path: ROUTES.HOME,
        exact: true,
        component: CreateUrl,
        isPrivatePath: false,
        redirect: false,
      },{
        path: ROUTES.LIST,
        exact: true,
        component: UrlList,
        isPrivatePath: true,
        redirect: true,
      },{
        path: ROUTES.WORDS,
        exact: true,
        component: WorldsContainer,
        isPrivatePath: true,
        redirect: true,
      },{
        path: ROUTES.SIGNIN,
        exact: true,
        component: Signin,
        isPrivatePath: false,
        redirect: false,
      },{
        path: ROUTES.SIGNUP,
        exact: true,
        component: Signup,
        isPrivatePath: false,
        redirect: true,
      }
    ]
  }
];

export default routes;
